(22, 'Stacey', 'ccpnpzn@yahoo.com', 'http://2hams.com/dfft1', 'Website visitors do not come easy these days. It’s hard and it usually takes a long time. In many cases, too much time… So much that you might be ready to give up. Someone shared a web traffic service with me on my website and I want to share it with you. I was skeptical at first but I tried their free trial period and it turns out they are able to get hundreds of visitors to anyones website every day. My sales revenue has increased tenfold. Check it out here: http://2hams.com/112s', '2013-12-03 07:20:56', 0, '0000-00-00 00:00:00'),
(23, 'seo', 'wcwjpyzidn@gmail.com', 'http://www.2014SeoTips.com/', 'Hello Web Admin, I noticed that your On-Page SEO is is missing a few factors, for one you do not use all three H tags in your post, also I notice that you are not using bold or italics properly in your SEO optimization. On-Page SEO means more now than ever since the new Google update: Panda. No longer are backlinks and simply pinging or sending out a RSS feed the key to getting Google PageRank or Alexa Rankings, You now NEED On-Page SEO. So what is good On-Page SEO?First your keyword must appear in the title.Then it must appear in the URL.You have to optimize your keyword and make sure that it has a nice keyword density of 3-5% in your article with relevant LSI (Latent Semantic Indexing). Then you should spread all H1,H2,H3 tags in your article.Your Keyword should appear in your first paragraph and in the last sentence of the page. You should have relevant usage of Bold and italics of your keyword.There should be one internal link to a page on your blog and you should have one image with an alt tag that has your keyword....wait there''s even more Now what if i told you there was a simple Wordpress plugin that does all the On-Page SEO, and automatically for you? That''s right AUTOMATICALLY, just watch this 4minute video for more information at. <a href="http://www.2014SeoTips.com">Seo Plugin</a>', '2013-12-12 05:52:08', 0, '0000-00-00 00:00:00'),
(24, 'Haji Yasir Shah', 'virsa1987@gmail.com', 'islamic Clothing Manufacturer', 'IN THE NAME OF ALLAH THE BENEFICENT AND THE MOST MERCIFULL\n \nDear Sir/Madam!\n \n                        Hope you would be doing fine.\n \nWe manufacture and export Abayas, Jilbabs, Maxi Dress, Kaftans, Thobes, Shalwar Kameez, Hijabs, Khimars and other similiar clothings.\n \n\nWe can send you all the details on your request.\n \nWe can also make your designs and sizes too.\n \nWe are manufacturing and exporting  for the last 15 years.\n\nWe can send you more details on your request..\n \nPlease contact us if you need islamic Clothings.\n \nAwaiting your return email.\nBest Regards;\n                  Haji Yasir Shah\nFor - Virsa Fashions, Lahore. Pakistan\npaarsafashions@gmail.com', '2014-02-22 09:22:09', 0, '0000-00-00 00:00:00'),
(25, 'Donna', 'qthulk@gmail.com', 'http://posco.com.br/yourls/tny', 'You need targeted visitors for your website so why not try some for free? There is a VERY POWERFUL and POPULAR company out there who now lets you try their website traffic service for 7 days free of charge. I am so glad they opened their traffic system back up to the public! Sign up before it is too late: http://go.lptipm.org/2pa', '2014-05-09 06:14:03', 0, '0000-00-00 00:00:00'),
(26, 'Morty', 'support@superbsocial.net', 'I stumbled upon your site zafranperfumes.com', 'Hello, my name is Morty Goldman; I just stumbled upon your site - zafranperfumes.com - I''m sorry to write in such an odd manner, I thought to call you but I didn''t want to take up your time. What I have to say may be of great interest to you. Did you know that an overwhelming majority of businesses, organizations and celebrities buy likes and followers? What, you thought your competitor''s likes and followers are organic and naturally gained? Ha ha. \n \nJust recently Gangman Style ( http://www.youtube.com/watch?v=9bZkp7q19f0 ) reached a record 2 billion views. Now imagine the scale of Gangnam Style''s popularity being applied to your business! This is exactly how I deliver results to my clients - and I assure you that you''ll be overwhelmingly pleased with the outcome. \n \nGive us a call: +1 (877) 410-4002 \nor visit us at http://www.SuperbSocial.net', '2014-06-01 05:09:04', 0, '0000-00-00 00:00:00'),
(27, 'Pawan Agarwal', 'info@aromatika.in', 'Incense Sticks and Incense Burners', 'Dear Sir\n  \nWe are manufacturers and exporters/Wholesaler of Natural Masala Incense sticks, Perfumed Incense sticks, Incense Cones, Dhoop sticks, and many more items related to\nSpiritual and worship and decorations.\n \n1.Incense Sticks( 15 gram pack, Hexa pack and 8 stick Square)\n2.Incense Stand/Holder.(Ash Catcher) in Brass, Metal, Wooden\n3. Incense Box  Wooden \n4. Incense Cones & Brass Cone Holder.\n5. Oil Burners ( Ceramic & Soft Stone)\n6. Charcoal Tablets \n7. Incense Resin.( Amber ,Myrrh ,3 Kings, Jerusalem, Benzoin ,Guggal, Copal etc.,)\n8.Aroma Oils/Essential Oil.\n9.Tibetan Items- Singing Bowls, Bells, Tingsa, Durjii,Gong.\n10.Herbal/Ayurvedic Soaps,\n11.Crystal Gem Stone Items/Rough Crystals\n12.Alter Tiles Pentagram  (Wooden & Brass) Wooden, Alter Table.\n13. Meditation Cushion/ Yoga Bolster\n \n \nAlso please visit our website www.aromatika.in for more products  and our company details.\n \nYou are requested to kindly refer the above details and also please visit our website www.aromatika.in  and let us know your\ninterested items details so that we can send you price and other details accordingly.\n \nThanking you and awaiting for your valued reply.\nRegards\nPawan Agarwal\nBhagwati Sales\n10/20, Vidhyadhar Nagar\nJaipur-302023-India\nTel; +911412232638\nMobile: +919829054351.\nE-Mail: info@aromatika.in\nWebsite: www.aromatika.in \nhttp://aromatika.trustpass.alibaba.com/ \n', '2014-06-11 08:02:14', 0, '0000-00-00 00:00:00');
