(2, 2, 0, '', '', 'SOAP - Body Butter, Mango Butter, Shea Butter & Aloe', '4.25 oz. 100% Vegetable Base by Black Soap.\n\nBody butter soap contains a unique blend of mango, shea butter and aloe which softens, moisturizes and soothes dry skin, conditioning while tempting the senses with a bouquet of natural fragrance.\n', '', '', 1, 1, 2),
(3, 2, 0, 'S 0110', 'SOAP - Eucalyptus Soap with Lemongrass', 'SOAP - Eucalyptus Soap with Lemongrass', 'AROMATHERAPY SOAP - STRESS RELIEF BODY BAR\n\n5.00 oz Bar, 100% Vegetable Based.\n\nStress Less! This ultra rich body bar with a unique purifying blend of Natural Eucalyptus and Lemongrass helps clarify and condition your skin while its aromatherapeutic combination helps clear the mind and relieve stress. In addition, natural tea tree extracts nourishes and moisturizes to leave your skin beautifully hydrated.\n\n', '', '1719942265_1338703975.jpg', 1, 0, 2),
(4, 2, 0, '', '', 'SOAP - Mango & Mandarin with Shea Butter', '4.25 oz 100% Vegetable Based Fruit Soap.\n\nA unique combination of Mango, Shea Butter, and Mandarin Orange clean, condition and sooth tired, dry skin in this rich and distinctive soap.\n\n', '', '1697427825_1338704309.jpg', 1, 0, 3),
(5, 2, 0, '', '', 'SOAP - Oatmeal & Vitamin E', '4.25 oz. 100% Vegetable Based Oatmeal Soap.\n\nA rare blend of Shea Butter, Oatmeal and Vitamin E, this pure vegetable soap gently cleanses and moisturizes, while rejuvenating the skin with its natural anti-aging properties.\n\nGreat for sensitive, dry and Eczema prone skin.\n\n', '', '1700189435_1338704747.jpg', 1, 0, 3),
(6, 2, 0, '', '', 'SOAP - Olive Butter Soap with Grape Seed Oil', 'AROMATHERAPY SOAP - MOISTURIZING BODY BAR\n\n5.00 oz Bar, 100% Vegetable Based.\n\nThe naturally nutrient rich combination of Olive Butter & Grape Seed Oil regenerates & softens dry & damaged skin cells delivering moisture to the skin while washing away dry surface cells. This formula is carefully blended with aromatherapeutic oils to help balance your senses.\n\n', '', '1298435216_1338705034.jpg', 1, 0, 3),
(7, 2, 0, '', '', 'SOAP - Papaya Glycerin Noodle Soap with Sweet Almond Oil', '5oz Bar. 100% Vegetable Based Papaya Soap.\n\nSunaroma introduces to you its one of a kind Papaya Glycerin Noodle Soap with Sweet Almond Oil.\n\nThis ultra rich body bar with cucumber extract helps keep your skin clean, soft and moisturized using its distinctive glycerin noodles which helps attract moisture to your skin as an aromatherapeutic blend of Papaya & Sweet Almond Oil help relax your body and soul.', '', '363683700_1338705421.jpg', 1, 0, 3),
(8, 2, 0, '', '', 'SOAP - Shea Butter & Aloe Vera', '4.25 oz. 100% Vegetable Based Soap by Black Soap.\n\nAfrican Shea Butter & Aloe Vera Soap is a naturally moisturizing, skin conditioning cleanser of the highest quality and purity.\n\nThe hydrating and healing properties of this Shea Butter Soap is great for all skin types, including those with dry, damaged, sensitive and ezcema prone skin. Keep your skin feeling and looking healthier everyday.', '', '1656332587_1338705741.jpg', 1, 0, 3),
(9, 2, 0, '', '', 'SOAP - Shea Butter & Aloe Vera', '4.25 oz. 100% Vegetable Based Soap by Black Soap.\n\nAfrican Shea Butter & Aloe Vera Soap is a naturally moisturizing, skin conditioning cleanser of the highest quality and purity.\n\nThe hydrating and healing properties of this Shea Butter Soap is great for all skin types, including those with dry, damaged, sensitive and ezcema prone skin. Keep your skin feeling and looking healthier everyday.', '', '1918010648_1338705747.jpg', 1, 0, 3),
(10, 2, 0, '', '', 'SOAP - Strawberry Glycerin Noodle Soap with Jojoba Butter', '5oz Bar. 100% Vegetable Based Strawberry Soap.\n\nSunaroma introduces to you its one of a kind Strawberry Glycerin Noodle Soap with Jojoba Butter.\n\nThis ultra rich body bar with Chamomile helps keep your skin clean, soft and moisturized using its distinctive glycerin noodles which helps attract moisture to your skin as an aromatherapeutic blend of Strawberry and Jojoba Butter tingles your senses.\n\n', '', '522082218_1338706107.jpg', 1, 0, 3),
(11, 2, 0, '', '', 'SOAP -Baby Bar With Shea Butter & Olive Oil H 21', '3.5 oz. 100% Vegetable Base by Black Soap.\nA gentle, moisturizing soap, enriched with shea butter, olive oil & aloe to keep our most youngest ones skin soft, smooth & protected.\n\nGreat for people with sensitive skin and of course great for babies as well.\n\n', '', '1181859608_1338706404.jpg', 1, 0, 3),
(12, 2, 0, '', '', 'SOAP -Beauty Bar With Moisturizing Lotion H 11', '3.5 oz. 100% Vegetable Base by Black Soap.\n\nA finely textured moisturizing and skin conditioning soap, enriched with mineral oil and coconut to help maintain beautiful skin. Suitable for all skin types.\n\n', '', '1430445698_1338706614.jpg', 1, 0, 3),
(13, 2, 0, '', '', '	 	spacer SOAP -Cocoa Butter & Vitamin E', '4.25 oz.100% Vegetable Based Soap by Black Soap.\n\nThis Creamy Moisturizing Cocoa Butter Soap with pure Cocoa Butter and Vitamin E cleans & lifts away dirt & Bacteria from your skin, without clogging pores or leaving your skin greasy and shiny.\n\nWorks great for marks and blemishes.\nSoftens rough, dry skin.\nExcellent for use on face, hand and body.\nUse daily for a smooth,clear radiant complextion.\n\n', '', '1630213689_1338706844.jpg', 1, 0, 3),
(14, 2, 0, '', '', 'SOAP -Lily & Lilac H 62', '4.25 oz. 100% Vegetable Based Floral Soap.\n\nOils of lilac, lily and natural botanical extracts combine in this fragrant vegetable soap providing elasticity and a velvety feel to tired, dry skin.\n\n', '', '655243671_1338707235.jpg', 1, 0, 3),
(15, 2, 0, '', '', 'SOAP -Multivitamin, Vitamin C, E, A, D, B & Aloe H 41', '3.5 oz. 100% Vegetable Base by Black Soap.\n\nA total skin care soap that softens, moisturizes and exfoliates while enriching the skin with a powerful vitamin based antioxidant formula to help maintain and promote healthy skin.', '', '1727039981_1338707591.jpg', 1, 0, 3),
(16, 2, 0, '', '', 'SOAP -Night Queen, With Royal Jelly Extract H 54', '4.25 oz. 100% Vegetable Base by Black Soap.\n\nA pure vegetable soap with a rich and gentle lather formulated with natural royal jelly, a skin conditioning agent harvested from the queen honey bee. This uniquely blended formula rejuvenates and soothes skin cells for a young healthy looking complexion.\n\n', '', '355903413_1338707805.jpg', 1, 0, 3),
(17, 2, 0, '', '', 'SOAP -Rose & Jasmin', '4.25 oz. 100% Vegetable Based Floral Soap.\n\nWith a sensual blend of rose and jasmin, and a nutrient rich lather of butter milk, wheat germ and vitamin e, this natural vegetable soap deeply moisturizes and conditions, leaving skin feeling pampered and silky smooth.\n\n', '', '1491826739_1338708061.jpg', 1, 0, 3),
(18, 2, 0, '', '', 'SOAP -Soy Milk With Chamomile & Cucumber H 8', '4.25 oz. 100% Vegetable Based Soap by Black Soap. Soy Milk Soap bathes the skin in a rich lather of soy protein and vitamin E, while softening and moisturizing with essential extracts of chamomile and cucumber.\n\n', '', '1429073574_1338708247.jpg', 1, 0, 3),
(19, 12, 0, '10000', '', 'Exfoliating Shower Gel - Non Fragrance H112', 'Exfoliating Shower Gel enriched with Sheabutter, Aloe Vera, Vitamin E and Sweet Almond Oil.\n\nThis moisturizing Shower Gel leaves no filmy residue - so skin feels cleaner, softer and, healthier.\n\nSpecially formulated with Spa Minerals and Gentle Exfoliating Beads, softly buff the skin to reveal a healthy radiant glow.', '', '1254079009_1338708465.jpg', 1, 1, 4),
