(252, 13, 0, 'C 5511', 'Fair & Lovely', 'Fair & Lovely - Menz Active Cream ', 'Male and female skin condition differs in three critical ways, which is why Fair & Lovely, the worlds leading fairness expert now brings you Menz Active, a breakthrough fairness cream especially tailored for men. Formulated by the Unilever Skin Research Centre, men have found this cream to be significantly better than womens fairness creams in side-by-side tests. Gives fairness in 6 weeks upon twice daily use. In addition with every application, you will get long lasting freshness, smooth skin and after shave protection. ', '', '2130516910_1343462769.jpg', 1, 0, 1),
