(256, 99, 0, 'S 9191', '', 'Large Desert Sage Smudge Bundle Stick, 8 to 9 inches', 'CALIFORNIA SAGE: Using a smudging tool is part of many Native American traditions. The burning of herbs for emotional, psychic, and spiritual purification is also common practice among many religious, healing, and spiritual groups.\n\nThe ritual of smudging can be defined as "spiritual house cleaning." In theory, the smoke attaches itself to negative energy and as the smoke clears it takes the negative energy with it, releasing it into another space where it will be regenerated into positive energy. \n', 'CALIFORNIA SAGE: Using a smudging tool is part of many Native American traditions. The burning of herbs for emotional, psychic, and spiritual purification is also common practice among many religious, healing, and spiritual groups.\n\nThe ritual of smudging can be defined as "spiritual house cleaning." In theory, the smoke attaches itself to negative energy and as the smoke clears it takes the negative energy with it, releasing it into another space where it will be regenerated into positive energy. \n', '512354145_1343466995.jpg', 1, 0, 1),
