(258, 101, 0, 'S 1020', '', 'Himalayan Crystal Bath Salt - Pink ', 'Product Description\nOur Buyer in Pakistan hand selects only the best quality Himalayan salt directly from the mine.Our Premium Himalayan Pink Crystal Salt is 100% pure, hand-mined and selected in Pakistan. It is found naturally deep inside the pristine Himalayan Mountains.\nHow to use: salt water baths or soaks to help heal your bodyYour skin is an excretive organ that mirrors the condition of your intestines. When you take a brine bath, the salt minerals penetrate your skin in form of ions. This stimulation will cause natural cell growth in your living cell layers. Bio-energetic weak points will be balanced and your body''s energy flow will be activated.The detoxifying effect of a brine bath can be compared to a 3-day fast. Since salt is also a disinfectant. To get the full benefits of a therapeutic natural crystal salt bath, the right salt concentration is critical. The salt concentration has to be at least the same as the one of your body fluids (approximately 1%) to activate the osmotic exchange ratio. The formula for a 1% solution is 1.28 ounces of salt per gallon of water.Since a full tub normally takes from 100 to 120 liters (27 - 32 gallons) of water, at least 1.2 kg. (2.6 pounds) of natural salt is required.\n \n', 'WARNING: While brine baths have a positive effect on many ailments, they are also demanding on your circulatory system.', '764887583_1343536483.jpg', 1, 0, 1),
