(265, 98, 0, 'H 7111', 'Dabur Amla', 'Dabur Amla Jasmine Hair Oil - 200ml', 'Dabur Amla Jasmine Hair Oil - 200ml\nFor Long, Strong, Freshly Fragrant Shining Hair - For Coloured Hair That Needs Protection\nThe goodness of Dabur''s original Amla oil now combined with the pleasant fragrance of Jasmine flower.\nUsage: Use your fingertips to gently massage oil into scalp and hair.\n\nIngredients: Mineral Oil (Paraffinum Liquidum), Canola Oil Elaeis guineensis oil, Phyllanthus emblica (Amla) Extract, Perfume (Jasmine), Isopropyl Myristate, Cyclopentasiloxane, Phenyl trimethicone, Butyl Methoxydibenzoylmethane, Rosmarinus officinalis oil, Tocopheryl Acetate, Tertiary Butyl Hydroquinone, D&C Yellow No. 11 (CI 47000), D&C Green No. 6 (CI 61565)\n\n \n \n\n\n\n \n', '', '119860082_1361868319.jpg', 1, 0, 1),
(266, 98, 0, 'H 7112', 'Vatika', 'Dabur Vatika Enriched Coconut Hair Oil, 5.07 Ounce ', 'Product Description\nDabur Vatika Enriched Coconut Hair Oil invigorates your hair with a nourishing formula, and restores key nutrients. Unlike ordinary coconut oils, Dabur Vatika''s oil is enriched with the goodness of eight, time-tested herbs, including brahmi and henna. These herbs, as if infused with magic, revitalize your hair and scalp for a holistic and enriching shine. Enjoy fuller and healthier hair with Dabur Vatika’s Enrich Coconut Hair Oil! The innovative formula, infused with Soya and Rosemary, makes hair strong, thick and brilliant, while providing better dandruff control. Dabur Vatika’s shampoos, oils and creams are customer tested, and infused with natural ingredients. For smooth hair that pours over your shoulders like cream, choose Dabur Vatika’s shampoos and oils. ', '', '25633715_1343636311.jpg', 1, 0, 1),
