(286, 106, 0, 'M 7321', '', 'Water Humidifier Fountain Lamp ', 'Multimode Mist Maker Water Humidifier Fountain Lamp :\nThis is the newest model of mist fountain. It can decorate your home or office. Also as night light lamp, air purifier, humidifier and aromatic diffuse.         \nOur mist fountain has the best mist maker machine that the other mist fountain did not have. Our mist maker machine has following fount ion\n\n•Water level sensor (turns mister OFF automatically when the water level is low)   \n•16mm mister disk (extra high mist output, 300ml per hour)   \n•Newly designed splashing cap (keeps water from spilling)   \n•12 colorful LED lights •Bowl Size 16 inch \n•Total Height is 34 inch \n', '', '1368479067_1344841467.jpg', 1, 0, 1),
