(293, 112, 0, 'H8828', 'Jui', 'Jui Coconut Oil', 'Jui Coconut Oil\nOver the years, Jui Coconut Oil has become a standard for haircare to Bangladeshi women. Jui is the best quality refined coconut oil that makes your hair naturally soft and healthy, which will in turn get you the appreciation from your close ones– appreciation that you truly deserve. For convenience, Jui Coconut Oil is available in both Plastic and Tin containers. \n\n', 'Who else wants healthy and beautiful hair? Or you always seem to have a bad hair day? We have complete hair solution for you. Jui is the ultimate solution for your healthy hair. \n\nFrom the beginning of history, the beauty of woman''s hair has been the inspiration for poets, musicians and painters. Although times and hair fashions have changed, there is nothing more attractive than shiny, silky layers of hair. Hair enhances overall attractiveness and thus can be incorporated into romance. Would not you love to have a glowing head of hair that will turn every man''s head for a long admiring glance and freeze other women in their tracks with envy? If you do, you need Jui. Now you can say goodbye to your dull hair forever and get long, healthy, beautiful and romantic hair with Jui.\n\nThe type of care your hair needs depends on your hair type and on its unique need. The skin and hair type of Bangladeshi women is different from those in other places of the world. We are Bangladeshi and we understand your unique need better than others do. For the last 20 years, Jui has been taking care of Bangladeshi women''s hair with tenderness. Based on different hair care needs, Jui has come up with two varieties of hair care for you: Jui Hair Care Oil and Jui Coconut Oil.\n\nJui understands our culture, our tradition of long, healthy and shiny hair. Jui is always coming up with new innovations to meet the individual and changing need of women– always caring for what you want and what you need. \n\n', '514416969_1356246178.jpg', 1, 0, 1),
