(295, 111, 0, 'CO6634', 'Natural Raw Coco Butter', 'Natural Raw Coco Butter', '1. USE AS AN EDIBLE BUTTER:Cocoa Butter is edible and possesses an extraordinary rich, delicate chocolate aroma. Add a piece of this ecstatic butter to your favorite smoothie, dessert, ice cream or chocolate creation. Because it has not been damaged by heat, our cocoa butter melts easily and blends nicely into any type of recipe. \n2. TREATING DARK SPOTS:Helps greatly in treating dark spots, stretch mark , burns, irritation in psoriasis, wrinkles, blemishes, diaper rash, scars & skin discolorations. \n3. AS A MOISTURIZER and HEALER for SKIN:Cocoa butter may be used as a skin moisturizer. The moisturizing abilities of cocoa butter are frequently recommended for prevention of stretch marks in pregnant women, treatment of chapped skin and lips, and as a daily moisturizer to prevent dry, itchy skin. \nAntioxidants:Cocoa has more antioxidant flavonoids than any food tested so far, including blueberries, red wine, and black and green teas. In fact, it has up to four times the quantity of antioxidants found in green tea. \nHealth benefits of these antioxidants include:?Promote cardiovascular health,?Protect from environmental and metabolic toxins,Help repair and resist damage caused by free radicals, and may reduce risk of certain cancers. ', '', '1822589418_1356492333.jpg', 1, 0, 1),
