(358, 114, 0, 'TB -1100', 'Tibetan Singing Bells  Tibetan Bell with Dorje and Striker - 5'''' Bronze', 'Tibetan Singing Bells  Tibetan Bell with Striker - 8'''' Bronze', 'The dorje and bell are the primary ritual tools of tibetan buddhism. Always kept together they represent many layers of intricate symbolism and meaning and are used in almost all Tibetan ritual ceremony, chanting and magical operations. Primarily dorje and bell represent the masculine and feminine principles in the cosmos and in the individuals energy body. The dorje is always held in the right hand and the bell in the left as these are the sides of the right and left channels in the body.\n', 'The dorje and bell are the primary ritual tools of tibetan buddhism. Always kept together they represent many layers of intricate symbolism and meaning and are used in almost all Tibetan ritual ceremony, chanting and magical operations. Primarily dorje and bell represent the masculine and feminine principles in the cosmos and in the individuals energy body. The dorje is always held in the right hand and the bell in the left as these are the sides of the right and left channels in the body.\nAdded on December 06, 2012', '772338911_1357447258.jpg', 1, 0, 1),
(359, 113, 0, 'BW 8820', ' Singing Bowls', 'Tibetan Meditation Om Mani Padme Hum Peace Singing Bowl With Mallet', '4.5 wide and 2.25 tall bowl, with a wooden striker. It weighs about a pound and is very solid and has a nice long lasting tone.As these are individually made, please note the engraving may not be exactly the symbols shown in the picture.A singing bowl is a type of bell shaped as a bowl. They come in many shapes and sizes, and are made using seven metals, which are copper, tin, lead, iron, zinc, silver, and gold. Singing bowls were traditionally made throughout Asia. The tradition continues today in Nepal, India, China, and Japan.', '4.5 wide and 2.25 tall bowl, with a wooden striker. It weighs about a pound and is very solid and has a nice long lasting tone.As these are individually made, please note the engraving may not be exactly the symbols shown in the picture.A singing bowl is a type of bell shaped as a bowl. They come in many shapes and sizes, and are made using seven metals, which are copper, tin, lead, iron, zinc, silver, and gold. Singing bowls were traditionally made throughout Asia. The tradition continues today in Nepal, India, China, and Japan.', '1725191726_1357453638.jpg', 1, 0, 1),
(360, 76, 0, 'C 8011', 'Celestial Wood Incense Box Burner Black 12"L ', 'Celestial Wood Incense Box Burner Black 12"L ', 'Celestial Wood Incense Box Burner Black 12"L ', 'Celestial Wood Incense Box Burner Black 12"L ', '1857607942_1357457136.jpg', 1, 0, 1),
(361, 116, 0, 'E 0505', 'Blue Heaven Kajal Eyeliner', 'Blue Heaven Kajal Eyeliner', 'The total case is 2.25 (6cm) inches tall, the kajal is 3cm tall. \nSpecially formulated KAJAL with the combination of some exotic herbal extracts to offer. \nMatte-finish. Non Smudging Resistant to perspiration. Safe to use & no irritation Easy to apply.  \nThe slim-line tip is best at obtaining the precision line. \nThe sheer water proof texture of this Kajal stick prevents dragging around the sensitive eye area. \n It delivers the color and precision without any fading, mess or spills. ', 'BLUE HEAVEN KAJAL SAFETY INSTRUCTIONS: Our Kajals are lead free, they are meant to be applied on the waterline. \nThey give eyes definiton and beauty. \nHowever please do not use them if: Your eyes are allergic to any chemical or wax. \nYou are applying any liquid medicine to your eyes. \nOn application there is itching.', '684098651_1357459725.jpg', 1, 1, 1),
(362, 116, 0, 'E 0505', 'Blue Heaven Kajal Eyeliner', 'Blue Heaven Kajal Eyeliner', 'The total case is 2.25 (6cm) inches tall, the kajal is 3cm tall. \nSpecially formulated KAJAL with the combination of some exotic herbal extracts to offer. \nMatte-finish. Non Smudging Resistant to perspiration. Safe to use & no irritation Easy to apply.  \nThe slim-line tip is best at obtaining the precision line. \nThe sheer water proof texture of this Kajal stick prevents dragging around the sensitive eye area. \n It delivers the color and precision without any fading, mess or spills. ', 'BLUE HEAVEN KAJAL SAFETY INSTRUCTIONS: Our Kajals are lead free, they are meant to be applied on the waterline. \nThey give eyes definiton and beauty. \nHowever please do not use them if: Your eyes are allergic to any chemical or wax. \nYou are applying any liquid medicine to your eyes. \nOn application there is itching.', '160072446_1361866997.jpg', 1, 0, 1),
(363, 117, 0, 'EO 2210', 'Lavender Essential Oils', 'Lavender Essential Oils', 'Lavender Essential Oil is a distillate of the herb  ‘Lavandula latifolia’. It’s found in many household items and is known for  various aromatherapy uses. Almost always found in liquid form, it is colorless  and is not a pure compound.  The biggest  producer is currently Bulgaria, although there are many sources from around the  world that are also large lavender oil producers.  Each of these regions around the world are  known for producing a product with slightly different characteristics and aromas.  It is for this reason that we carry 8  different versions at this time and are currently one of the largest importers  of lavender essential oil in the USA.', '', '150599280_1357462723.jpg', 1, 0, 1),
(364, 117, 0, 'EO 2211', 'Eucalyptus Essential Oil', 'Eucalyptus Essential Oil', 'Uses For Eucalyptus Oil\n\nComing from the leaf of the Eucalyptus plant, Eucalyptus  Essential Oil can be found worldwide, but hails originally from Australia.  Colonials originally discovered the benefits of the oil in ‘eucalyptus  piperita’ around 1788, but it wasn’t used commercially until long  thereafter.  It is a pale yellow liquid  used primarily as an antiseptic or fragrance.', '', '211228657_1357463074.jpg', 1, 0, 1),
(365, 117, 0, 'EO 2212', 'Peppermint Essential Oil ', 'Peppermint Essential Oil ', 'Peppermint oil is native to Japan: also known as ‘mentha arvensis’ and is found in countless U.S. household products. It has a high concentration of natural pesticides, one in particular is menthone. This yellow oil is steam distilled directly from the herb and although tt is most commonly found in liquid form, it can also be seen in capsules or tablets in many health food stores. Peppermint oil is high in omega-3 fatty acids, Vitamin A, C, minerals, manganese, iron, calcium, magnesium, folate, copper and potassium.', '', '143379720_1357463309.jpg', 1, 0, 1),
(366, 117, 0, 'EO 2213', 'Frankincense (India) Essential Oil', 'Frankincense (India) Essential Oil', 'Botanical Name: Boswellia Serrata Plant Part: Resin Extraction Method: Steam Distilled Origin: India Color: Colorless to pale yellow clear liquid. Common Uses: The therapeutic properties of Frankincense Essential Oil include use as an antiseptic, astringent, carminative, digestive, diuretic, sedative, tonic and expectorant. Frankincense is said to help rejuvenate the aging skin, and is effective with bacterial and fungal infections. The anti-inflammatory property of this oil is reputed to be an effective treatment for joint pain and arthritis. Frankincense can also be used as an insect repellent and is also widely used in cosmetics and soap manufacturing. It has a grounding aroma, and often used in meditation. Consistency: Medium Note: Base Strength of Aroma: Medium Aromatic Scent: Frankincense Essential Oil has a rich woody, earthy scent with a deeply mysterious nuance. Cautions: Frankincense Essential Oil is non-toxic, non-irritant and non-sensitizing. Avoid use during pregnancy.', '', '832322955_1357463654.jpg', 1, 0, 1),
(367, 117, 0, 'EO 2214', 'Sandalwood Essential Oil', 'Sandalwood Essential Oil', 'Botanical Name: Santalum album Plant Part: Wood Extraction Method: Steam Distilled Color: Colorless to pale yellow clear thick liquid. Common Uses: Sandalwood East Indian Essential Oil is used by aromatherapists to combat bronchitis, chapped and dry skin, depression, laryngitis, leucorrhea, oily skin, scars, sensitive skin, stress, and stretch marks. It also has historical applications as an aid in meditation for religious ceremonies. Sandalwood East Indian is believed to create an exotic, sensual mood with a reputation as an aphrodisiac. It also has extensive uses in the perfume industry as a fixative, and use in body care products for the fragrance it provides. Consistency: Medium Note: Base Strength of Aroma: Medium Aromatic Scent: Sandalwood East Indian Essential Oil has a rich, balsamic, sweet fragrance with delicate wood notes that add to it''s reputation as a luxurious and exquisite oil. Cautions: Sandalwood East Indian Essential Oil is considered non-toxic, non-irritant and non-sensitizing oil.', '', '1848819577_1357464170.jpg', 1, 0, 1),
(368, 117, 0, 'EO 2215', 'Patchouli (Dark) Essential Oil', 'Patchouli (Dark) Essential Oil', 'Botanical Name: Pogostemon Cablin Plant Part: Leaves Extraction Method: Steam Distilled Origin: Indonesia Common Uses: Patchouli is recognized by aromatherapists as being effective for combating nervous disorders, helping with dandruff, sores, skin irritations and acne. The specific properties include use as an antidepressant, anti-inflammatory, anti-emetic, antimicrobal, antiphlogistic, antiseptic, antitoxic, antiviral, aphrodisiac, astringent, bactericidal, carminative, deodorant, digestive, diuretic, febrifuge, fungicidal, nerving, prophylactic, stimulating and tonic agent. In the perfumery industry, it is interesting to note that Patchouli improves with age, and that the aged product is what is preferred over freshly harvested. In aromatherapy, Patchouli is an excellent fixative that can help extend other, more expensive oils. Consistency: Thick Note: Base Strength of Aroma: Medium Aromatic Scent: Patchouli has a warm, earthy aroma with fresh fruit - like tones. Cautions: None Known.', '', '615337531_1357464521.jpg', 1, 0, 1),
(369, 117, 0, 'EO 2216', 'Golden Jojoba Oil', 'Golden Jojoba Oil', 'Pure Golden Jojoba oil is a very unique oil known for its high vitamin E content which gives it an almost indefinite shelf life. This makes Golden Jojoba Oil great for diluting essential oils. Furthermore, jojoba offers amazing moisturizing properties making it ideal for massage oils, lotions, lip balms, soaps and more.', '', '1889162769_1357501363.jpg', 1, 0, 1);
INSERT INTO `product` (`product_id`, `p_main_cat_id`, `p_sub_cat_id`, `item_code`, `brand`, `product_name`, `description`, `additional_info`, `image`, `p_status`, `delete_status`, `pro_type`) VALUES
(370, 117, 0, 'EO 2217', 'Myrrh (India) Essential Oil', 'Myrrh (India) Essential Oil', 'Botanical Name: Commiphora myrrha Plant Part: Resin Extraction Method: Solvent Extraction Origin: India Common Uses: Indian Myrrh Essential Oil contains a number of flavonoids which assist in reducing inflammation and boosts the immune system. It is also reputed to be valued as a tonic, and is said to have antiseptic and anti-fungal properties. Indian Myrrh Essential Oil is very aromatic and is thought to enhance spirituality. Aromatherapists use both Myrrh and Frankincense to draw on the deeply meditative and healing quality of the oils. Consistency: Medium Note: Middle Strength of Aroma: Medium Aromatic Scent: Myrrh Essential Oil has a warm, rich, spicy balsamic odor Cautions: Myrrh Essential Oil can be possibly toxic in high concentrations, and should not be used during pregnancy.', '', '516530859_1357502669.jpg', 1, 0, 1),
(371, 117, 0, 'EO 2218', 'Gardenia Essential Oil', 'Gardenia Essential Oil', 'Gardenia Essential Oil is pure undiluted Gardenia Oil extracted by Enfleurage. Most Gardenia Oil is extracted by chemical solvents and is therefore called an "absolute" (Gardenia Absolute). Our Gardenia Oil is NOT an absolute, it is and essential oil and is most rare, coming from a small grower/extractor in South America. The entire process of extracting the gardenia oil it done by hand using no heat and no chemical solvents. Pure local palm oil is used to absorb the aromatic oils from the gardenia flower petals and once the palm oil is completely saturated with the essence of the gardenia flower then the palm oil is separated from the Gardenia oil by cane sugar alcohol which is then evaporated to leave only the Gardenia oil. The process for producing the Gardenia Essential Oil by Enfleurage is quite labor intensive and requires many pounds of gardenia flower petals per ml of oil but the results are astounding. If you close your eyes and inhale the aroma of the oil, you''ll find that the aromatic essence is quite similar to that of the actual gardenia flower', '', '1304007296_1357503453.jpg', 1, 0, 1),
(372, 117, 0, 'EO 2219', 'Bergamot Essential Oil', 'Bergamot Essential Oil', 'Botanical Name: Citrus bergamia Plant Part: Crude Fruit Peel Extraction Method: Cold Pressed Origin: Italy Color: Light yellowish green to yellowish brown liquid. Common Uses: Bergamot Essential Oil can be used in the treatment of depression, stress, tension, fear, hysteria, infection (all types including skin), anorexia, psoriasis, eczema and general convalescence. Consistency: Thin Note: Middle Strength of Aroma: Medium Aromatic Scent: The aroma is basically citrus, yet fruity and sweet with a warm spicy floral quality, and is reminiscent of Neroli and Lavender Oils. - Bulk bergamot essential oil Cautions: Bergamot Essential Oil can cause severe burns when used on sensitive skin that has been exposed to sunlight due to the high bergaptene content.', '', '1944957874_1357504158.jpg', 1, 0, 1),
(373, 117, 0, 'EO 2220', 'Cedarwood (Himalayan) Essential Oil', 'Cedarwood (Himalayan) Essential Oil', 'Botanical Name: Cedrus deodora Plant Part: Wood Extraction Method: Steam Distilled Origin: India Color: Yellowish to brownish yellow viscous liquid. Common Uses: Himalayan Cedarwood Essential Oil is believed to have the following properties: antiseptic, anti-putrescent, anti-seborrheic, aphrodisiac, astringent, diuretic, expectorant, fungicidal, mucolytic, sedative (nervous), stimulant (circulatory), tonic. In India, this oil has been shown to possess insecticidal and anti-fungal properties. Consistency: Thin Note: Middle Strength of Aroma: Strong Aromatic Scent: Cedarwood Himalayan has a dry woody aroma, slightly camphoraceous, smoky, balsamic, very subtle with a hint of spice. Cautions: Non-toxic, non-irritant and non sensitizing. Avoid during pregnancy.', '', '976246536_1357505036.jpg', 1, 0, 1),
(374, 117, 0, 'EO 2221', 'Jasmine Essential Oil', 'Jasmine Essential Oil', 'Botanical Name: Jasminum sambac Plant Part: Flowers Extraction Method: Solvent Extraction Color: Dark brown yellowish liquid. Common Uses: Jasmine Sambac Absolute is well regarded as an aphrodisiac, though it is also considered an antidepressant, sedative, and antispasmodic. Consistency: Thick Note: Middle Strength of Aroma: Strong Aromatic Scent: Jasmine Sambac Absolute is an incredibly intense aroma that is very floral, yet more musky and masculine than the Jasmine Grandiflorum. Cautions: It is important to note that all absolutes are extremely concentrated by nature. They should not be evaluated in this state unless you are accustomed to the undiluted fragrance. For those trying Absolutes for the first time, we strongly recommend they be evaluated in dilution. Otherwise, the complexity of the fragrance - particularly the rare and exotic notes - becomes lost.', '', '635757887_1357507322.jpg', 1, 0, 1),
(375, 117, 0, 'EO 2222', 'Clary Sage Essential Oil', 'Clary Sage Essential Oil', 'Botanical Name: Salvia sclarea Plant Part: Leaves and Flowers Extraction Method: Steam Distilled Origin: China Color: Colorless to pale yellow clear liquid. Common Uses: Clary Sage Essential Oil is viewed by aromatherapists as an antidepressant, antispasmodic, deodorant, emmenagogue, hypotensive, nervine, sedative, tonic and uterine. It is well known for providing a euphoric action, for balancing uterine issues, and as an agent to clean greasy hair. There is also some documentation of its effectiveness in helping to relax the spasms of asthma. Consistency: Medium Note: Middle Strength of Aroma: Medium Aromatic Scent: Clary Sage Essential Oil has an earthy, fruity and floral aroma that is both nutty and herbaceous. Cautions: Clary Sage Oil is non-toxic, and non-sensitizing. It is not to be used during pregnancy.', '', '1199458664_1357509185.jpg', 1, 0, 1),
(376, 117, 0, 'EO 2223', 'Rosemary Essential Oil', 'Rosemary Essential Oil', 'Botanical Name: Rosmarinus officinalis\nCommon Method Of Extraction: Steam distilled\nParts Used: Flowering tops\nNote Classification: Middle\nAroma: Strong, fresh, camphor-like and with a woody-balsamic undertone\nLargest Producing Countries: Spain, France, and Tunisia\n\nTraditional Use: Best known for its aid in memory and hair loss. It is also considered a symbol of love, and the sprigs have been traditionally used in wedding ceremonies.\n\nProperties: Analgesic, antiarthritic, antibacterial, antidepressant, antioxidant, antirheumatic, antiseptic, antispasmodic, aphrodisiac, astringent, carminative, cholagogue, cordial, decongestant, diaphoretic, digestive, diuretic, emmenagogue, expectorant, fungicidal, hepatic, hypertensive, nervine, restorative, rubefacient, stimulant, stomachic, sudorific, tonic, vermifuge, vulnerary\n\nBenefits: Acne, amenorrhea, arthritis, asthma, bronchitis, colds, colitis, constipation, coughs, dandruff, dermatitis, diarrhea, dysmenorrhea, eczema, fainting, flatulence, flu, fluid retention, greasy hair, hangovers, headache, hysteria, insect repellant, jaundice, leucorrhea, lice, memory loss, mental fatigue, migraine, muscle aches and pains, nervous disorders, neuralgia, rheumatism, scabies, sinus problems, slow circulation, sore muscles, tonic, varicose veins, whooping cough, wounds. Rosemary oil has many applications. Diffusing the oil into the air will aid memory and disinfect the room. Using the oil in a massage oil may help with nasal congestion and sore muscles.\n\nBlends Well With: Basil, bergamot, black pepper, cedarwood, cinnamon, citronella, clary sage, elemi, eucalyptus , frankincense, geranium, grapefruit, lavender, lemon, litsea cubeba, mandarin, marjoram, niaouli, oregano, peppermint, petitgrain, pine, ravensara, tea tree, thyme Of  Interest: Rosmarinus is Latin for dew (ros) of the sea (marinus).\nSafety Data: Avoid in epilepsy, hypertension, and while pregnant. Avoid with homeopathics.\n ', '', '1290393761_1357510095.jpg', 1, 0, 1),
(377, 117, 0, 'EO 2224', 'Magnolia Essential Oil', 'Magnolia Essential Oil', 'It is easy to understand why people love the scent of pure magnolia flowers… they truly offer an amazing aroma that both calms the nerves and stimulates awareness. Magnolia blossom essential oil is very concentrated and it can smell rather intense straight out of the bottle.\n\nIn order to enjoy the softer magnolia aroma that you are searching for, you will need to dilute the pure essential oil in a carrier or treatment oil. It’s pure form is quite strong. A little of this oil goes a really long way… and it smells incredible too!', '', '530031370_1357515102.jpg', 1, 0, 1),
(378, 117, 0, 'EO 2227', 'Ylang Ylang Essential Oil', 'Ylang Ylang Essential Oil', 'Botanical Name: Cananga Odorata Plant Part: Flowers Extraction Method: Steam Distilled Origin: Madagascar Description: Ylang-ylang Essential Oil is extracted from Cananga odorata  also known as flower of flowers. It is a tall tropical tree about 20meters (60 feet) high with large, tender, fragrant pink, mauve or yellow flowers. The yellow heads are viewed as being the best in terms of quality. There are several grades of Ylang-ylang essential oil which are extracted at different times during the flower''s lengthy distillation. These grades are referred to as extra, I, II, & III. This is the first distillation of the oil. Color: Pale to golden yellow clear liquid. Common Uses: Ylang-ylang Essential Oil can assist with problems such as high blood pressure, rapid breathing and heartbeat, nervous conditions, as well as impotence and frigidity. Ylang-ylang Essential Oil is best suited for use in the perfumery and skincare industries. Consistency: Thin Note: Base Strength of Aroma: Medium Aromatic Scent: Ylang-ylang Essential Oil has a sweet, exotic, floral scent that is one of the most sought after aromas. Cautions: Ylang-ylang Essential Oil can cause sensitivity on some people and excessive use of it may lead to headaches and nausea.', '', '704474624_1357534633.jpg', 1, 0, 1),
(379, 88, 0, 'H 0001', 'HEM CANNABIS INCENSE 8 STICKS (25/BOX)', 'HEM CANNABIS INCENSE 8 STICKS (25/BOX)', '', '', '2128835761_1357706155.jpg', 1, 0, 1),
