(387, 12, 0, 'L 0890', 'Nubian', 'Coconut & Papaya Lotion - Nubian Heritage - 8 oz - Lotion', 'Coconut & Papaya Lotion \n\nSweet-scented and nutrient-rich, the Nubian Heritage Coconut & Papaya Collection pays homage to the bounty of natural tropical ingredients. The coconut palm has touched all aspects of daily life for millions of tropical communities. Since the 1st Century B.C., the coconut tree has provided shelter, transportation and, more importantly, food. Coconut Oil, high in vitamins, minerals and fatty acids, is an excellent skin softener and protector. Papaya contains papain, a naturally occurring enzyme, used for centuries to gently dissolve dead skin cells, loosen pore blockage and stimulate circulation.\nKey Ingredients: Coconut Oil, Shea Butter, Papaya Enzymes, Comfrey Root extract\nBenefits: Antioxidant-rich Coconut Oil is easily absorbed into the skin to protect the skin against damage by preventing free radical formation. Coconut Oil also strengthens connective tissues to prevent sagging, wrinkles and blemishes, and helps reduce skin inflammation. Papaya enzyme exfoliates, stimulates circulation and firms skin. Shea Butter and anti-inflammatory Comfrey Root extract promote healing.\nUsage: all skin types\nNatural Aroma: sweet, tropical\n', '', '998665800_1357718590.jpg', 1, 0, 1),
(388, 12, 0, 'L 0891', 'Nubian Heritage', 'Lemongrass & Tea Tree Lotion - Nubian Heritage - 8 oz - Lotion', 'Lemongrass & Tea Tree Lotion \n\nEnergizing Lemongrass and antibacterial Tea Tree Oil blend with Shea Butter and Orange Oil to help heal, balance and restore moisture. Sunflower Oil, rich in Vitamin A, B, D and F, and anti-oxidant Vitamin E and Comfrey Root Extract nourish and protect the skin.\n', '', '268523015_1357719511.png', 1, 0, 1),
(389, 120, 0, 'CH 0012', 'THREE KINGS ', 'THREE KINGS CHARCOAL 33MM (SMALL)', '	\nThree Kings Charcoal 33mm\n\n~ Incense Burning Charcoal\n~ 10 Charcoals per roll\n~ 10 Rolls in a box\n\n', '', '418299038_1358400418.jpg', 1, 0, 1),
(390, 120, 0, 'CH 0013', 'THREE KINGS ', 'THREE KINGS CHARCOAL 40MM (LARGE)', 'Three Kings Charcoal 40mm\n\n~ Incense Burning Charcoal\n~ 10 Charcoals per roll\n~ 10 Rolls in a box', '', '2118021110_1358237813.jpg', 1, 0, 1),
(391, 120, 0, 'CH 0066', 'HOLLYWOOD ', 'HOLLYWOOD CHARCOAL TABLETS 24/CS', 'HOLLYWOOD CHARCOAL TABLETS 24/CS', '', '780222553_1358207771.jpg', 1, 0, 1),
(392, 88, 0, 'H5615', 'HEM', 'HEM DRAGONS BLOOD INCENSE 8 STICKS (25/BOX)  ', 'Hem Dragon''s Blood Incense 8 Sticks Square Pack\n \n \n', '', '1760560850_1358280023.jpg', 1, 0, 1),
(393, 88, 0, 'H5616', 'HEM', 'HEM VIOLET INCENSE 8 STICKS (25/BOX', 'Hem Violet Incense 8 Sticks Square Pack\n', '', '1919442853_1358280238.jpg', 1, 0, 1),
(394, 117, 0, 'EO 2228', 'Lemongrass', 'Lemongrass 100% Pure Essential Oil', '•Traditional Uses: Cleansing and purifying, tranquility and serenity, meditation, circulation, digestion. \n•History: Leave the hustle and bustle of everyday life behind and discover the tranquil bliss of Lemongrass. The soft, citrus undertones of our Lemongrass Oil will leave you feeling cleansed and serene, allowing you to explore pure meditative pleasure. This enriching oil has been traditionally used for healthy digestion and circulation. Our Lemongrass Oil is steam distilled – steam is used to vaporize the oils and active ingredients, so they can be extracted and condensed. This assures you of the purest aromatherapy experience. \n•Botanical Name: Cymbopogon citratus \n•Plant Part: Aerial Parts (Herb, Flower, Stem, Leaves) \n•Extraction Method: Steam Distillation \n•Country of Origin: India \n•Color: A light yellow to light brown liquid\n•Consistency: Thin to Medium \n•Note: Citrus, hay-like \n•Strength of Aroma: Strong \n•Blends well with: Bergamot, Lemon, Lime, Orange, Neroli and Sweet Orange. \n•Caution: For external use only. Do not use directly on skin, dilute in a carrier oil. Do not apply to broken or irritated skin. If skin sensitivity occurs, discontinue use. If you are pregnant, nursing or taking any medications, consult your doctor before use. Discontinue use and consult your doctor if any adverse reactions occur. Keep out of the reach of children. \n\nKeep oils away from eyes. Flammable. \n', '', '1732561027_1358281056.jpg', 1, 0, 1),
(395, 123, 0, 'CO 0221', 'Carrington Farms', 'Extra Virgin Coconut Oil', 'Carrington has been providing the health conscious consumer with healthy yet delicious products featuring exceptional quality combined with innovative and dynamic packaging.', '', '1512633376_1384818768.jpg', 1, 0, 1);
