(209, 374, 'Jasmine Essential Oil', 'Botanical Name: Jasminum sambac Plant Part: Flowers Extraction Method: Solvent Extraction Color: Dark brown yellowish liquid. Common Uses: Jasmine Sambac Absolute is well regarded as an aphrodisiac, though it is also considered an antidepressant, sedative, and antispasmodic. Consistency: Thick Note: Middle Strength of Aroma: Strong Aromatic Scent: Jasmine Sambac Absolute is an incredibly intense aroma that is very floral, yet more musky and masculine than the Jasmine Grandiflorum. Cautions: It is important to note that all absolutes are extremely concentrated by nature. They should not be evaluated in this state unless you are accustomed to the undiluted fragrance. For those trying Absolutes for the first time, we strongly recommend they be evaluated in dilution. Otherwise, the complexity of the fragrance - particularly the rare and exotic notes - becomes lost.', 1, 'OZ', 10.00, '88bc765218aa388af76307b2a7537ef6', 0),
(210, 363, 'Lavender Essential Oils', 'Lavender Essential Oil is a distillate of the herb  ‘Lavandula latifolia’. It’s found in many household items and is known for  various aromatherapy uses. Almost always found in liquid form, it is colorless  and is not a pure compound.  The biggest  producer is currently Bulgaria, although there are many sources from around the  world that are also large lavender oil producers.  Each of these regions around the world are  known for producing a product with slightly different characteristics and aromas.  It is for this reason that we carry 8  different versions at this time and are currently one of the largest importers  of lavender essential oil in the USA.', 4, 'OZ', 22.00, '88bc765218aa388af76307b2a7537ef6', 0),
(211, 370, 'Myrrh (India) Essential Oil', 'Botanical Name: Commiphora myrrha Plant Part: Resin Extraction Method: Solvent Extraction Origin: India Common Uses: Indian Myrrh Essential Oil contains a number of flavonoids which assist in reducing inflammation and boosts the immune system. It is also reputed to be valued as a tonic, and is said to have antiseptic and anti-fungal properties. Indian Myrrh Essential Oil is very aromatic and is thought to enhance spirituality. Aromatherapists use both Myrrh and Frankincense to draw on the deeply meditative and healing quality of the oils. Consistency: Medium Note: Middle Strength of Aroma: Medium Aromatic Scent: Myrrh Essential Oil has a warm, rich, spicy balsamic odor Cautions: Myrrh Essential Oil can be possibly toxic in high concentrations, and should not be used during pregnancy.', 1, 'OZ', 10.00, 'f81f3572170fb551132e1eedbfcdb006', 0),
(212, 374, 'Jasmine Essential Oil', 'Botanical Name: Jasminum sambac Plant Part: Flowers Extraction Method: Solvent Extraction Color: Dark brown yellowish liquid. Common Uses: Jasmine Sambac Absolute is well regarded as an aphrodisiac, though it is also considered an antidepressant, sedative, and antispasmodic. Consistency: Thick Note: Middle Strength of Aroma: Strong Aromatic Scent: Jasmine Sambac Absolute is an incredibly intense aroma that is very floral, yet more musky and masculine than the Jasmine Grandiflorum. Cautions: It is important to note that all absolutes are extremely concentrated by nature. They should not be evaluated in this state unless you are accustomed to the undiluted fragrance. For those trying Absolutes for the first time, we strongly recommend they be evaluated in dilution. Otherwise, the complexity of the fragrance - particularly the rare and exotic notes - becomes lost.', 1, 'OZ', 10.00, '75205052e71540c45d7106c417cc3ddc', 0),
(213, 363, 'Lavender Essential Oils', 'Lavender Essential Oil is a distillate of the herb  ‘Lavandula latifolia’. It’s found in many household items and is known for  various aromatherapy uses. Almost always found in liquid form, it is colorless  and is not a pure compound.  The biggest  producer is currently Bulgaria, although there are many sources from around the  world that are also large lavender oil producers.  Each of these regions around the world are  known for producing a product with slightly different characteristics and aromas.  It is for this reason that we carry 8  different versions at this time and are currently one of the largest importers  of lavender essential oil in the USA.', 1, 'OZ', 10.00, '75205052e71540c45d7106c417cc3ddc', 0),
(214, 362, 'Blue Heaven Kajal Eyeliner', 'The total case is 2.25 (6cm) inches tall, the kajal is 3cm tall. \nSpecially formulated KAJAL with the combination of some exotic herbal extracts to offer. \nMatte-finish. Non Smudging Resistant to perspiration. Safe to use & no irritation Easy to apply.  \nThe slim-line tip is best at obtaining the precision line. \nThe sheer water proof texture of this Kajal stick prevents dragging around the sensitive eye area. \n It delivers the color and precision without any fading, mess or spills. ', 1, 'pc', 1.00, '1b0eaa04f972c028565c627c05dc8cc3', 0),
