(222, 370, 'Myrrh (India) Essential Oil', 'Botanical Name: Commiphora myrrha Plant Part: Resin Extraction Method: Solvent Extraction Origin: India Common Uses: Indian Myrrh Essential Oil contains a number of flavonoids which assist in reducing inflammation and boosts the immune system. It is also reputed to be valued as a tonic, and is said to have antiseptic and anti-fungal properties. Indian Myrrh Essential Oil is very aromatic and is thought to enhance spirituality. Aromatherapists use both Myrrh and Frankincense to draw on the deeply meditative and healing quality of the oils. Consistency: Medium Note: Middle Strength of Aroma: Medium Aromatic Scent: Myrrh Essential Oil has a warm, rich, spicy balsamic odor Cautions: Myrrh Essential Oil can be possibly toxic in high concentrations, and should not be used during pregnancy.', 1, 'LB', 40.00, 'efc9d40da48e5494d3a90597e39175d6', 0),
(223, 366, 'Frankincense (India) Essential Oil', 'Botanical Name: Boswellia Serrata Plant Part: Resin Extraction Method: Steam Distilled Origin: India Color: Colorless to pale yellow clear liquid. Common Uses: The therapeutic properties of Frankincense Essential Oil include use as an antiseptic, astringent, carminative, digestive, diuretic, sedative, tonic and expectorant. Frankincense is said to help rejuvenate the aging skin, and is effective with bacterial and fungal infections. The anti-inflammatory property of this oil is reputed to be an effective treatment for joint pain and arthritis. Frankincense can also be used as an insect repellent and is also widely used in cosmetics and soap manufacturing. It has a grounding aroma, and often used in meditation. Consistency: Medium Note: Base Strength of Aroma: Medium Aromatic Scent: Frankincense Essential Oil has a rich woody, earthy scent with a deeply mysterious nuance. Cautions: Frankincense Essential Oil is non-toxic, non-irritant and non-sensitizing. Avoid use during pregnancy.', 1, 'LB', 42.00, 'efc9d40da48e5494d3a90597e39175d6', 0),
(224, 375, 'Clary Sage Essential Oil', 'Botanical Name: Salvia sclarea Plant Part: Leaves and Flowers Extraction Method: Steam Distilled Origin: China Color: Colorless to pale yellow clear liquid. Common Uses: Clary Sage Essential Oil is viewed by aromatherapists as an antidepressant, antispasmodic, deodorant, emmenagogue, hypotensive, nervine, sedative, tonic and uterine. It is well known for providing a euphoric action, for balancing uterine issues, and as an agent to clean greasy hair. There is also some documentation of its effectiveness in helping to relax the spasms of asthma. Consistency: Medium Note: Middle Strength of Aroma: Medium Aromatic Scent: Clary Sage Essential Oil has an earthy, fruity and floral aroma that is both nutty and herbaceous. Cautions: Clary Sage Oil is non-toxic, and non-sensitizing. It is not to be used during pregnancy.', 1, 'LB', 40.00, 'efc9d40da48e5494d3a90597e39175d6', 0),
