(267, 295, 'Natural Raw Coco Butter', '1. USE AS AN EDIBLE BUTTER:Cocoa Butter is edible and possesses an extraordinary rich, delicate chocolate aroma. Add a piece of this ecstatic butter to your favorite smoothie, dessert, ice cream or chocolate creation. Because it has not been damaged by heat, our cocoa butter melts easily and blends nicely into any type of recipe. \n2. TREATING DARK SPOTS:Helps greatly in treating dark spots, stretch mark , burns, irritation in psoriasis, wrinkles, blemishes, diaper rash, scars & skin discolorations. \n3. AS A MOISTURIZER and HEALER for SKIN:Cocoa butter may be used as a skin moisturizer. The moisturizing abilities of cocoa butter are frequently recommended for prevention of stretch marks in pregnant women, treatment of chapped skin and lips, and as a daily moisturizer to prevent dry, itchy skin. \nAntioxidants:Cocoa has more antioxidant flavonoids than any food tested so far, including blueberries, red wine, and black and green teas. In fact, it has up to four times the quantity of antioxidants found in green tea. \nHealth benefits of these antioxidants include:?Promote cardiovascular health,?Protect from environmental and metabolic toxins,Help repair and resist damage caused by free radicals, and may reduce risk of certain cancers. ', 16, 'OZ', 15.00, '095261d2bb9f74f4e0724d27717d62ee', 0),
(268, 183, 'RAW BLACK SOAP- PREMIUM   ', 'RAW African  Black Soap: (Source Internet)  \n\nAfrican traditional black soap is one of the most beneficial yet unheard of soaps you will ever find. Made from dried plantain skins, palm leaves, cocoa pod powder, and kernel oil for an all-natural cleansing process. Plantains skins are largely what make this soap so effective. Plantain is a fruit that grows in Africa & South America that looks similar to a banana, except it is much larger and tastes altogether different. You can find plantains at many ethnic or international grocery stores. It is a natural source of vitamins A & E and iron. When black soap is made, the skin of the plantain is gingerly dried to a precise texture under the sun. Afterwards it is roasted in a clay oven. The heat must be constant in order to achieve the perfect brownish black color, texture & smell. Afterwards, cocoa pod powder is added. Cocoa pod is the shell of the cocoa fruit and also has natural healing properties.\n\nThe next process is very precise because if it is not done properly, with the correct ingredients, there will be no soap. The roasted plantain skin is mixed with palm oil and palm kernel oil to form the soap. The roasted plantains determine the color of the soap. The longer the plantains are roasted, the darker the soap.\n\nIngredients:\n\n', 1, 'LB ', 12.99, '095261d2bb9f74f4e0724d27717d62ee', 0),
