(337, 230, '1 Dram Fancy Roll-on', '1 Dram size Rollon. \ncomes with Housing, ball and balck cap.\nSold by the Dozen, Gross (144/pcs) and case.', 12, 'Dozen', 60.00, 'ee708c66fdb32d4bc0ae3f5d0ac79fd7', 0),
(338, 364, 'Eucalyptus Essential Oil', 'Uses For Eucalyptus Oil\n\nComing from the leaf of the Eucalyptus plant, Eucalyptus  Essential Oil can be found worldwide, but hails originally from Australia.  Colonials originally discovered the benefits of the oil in ‘eucalyptus  piperita’ around 1788, but it wasn’t used commercially until long  thereafter.  It is a pale yellow liquid  used primarily as an antiseptic or fragrance.', 1, 'OZ', 10.00, '2e541eff1ecf9c29cd8b82820e3257c6', 0),
(339, 363, 'Lavender Essential Oils', 'Lavender Essential Oil is a distillate of the herb  ‘Lavandula latifolia’. It’s found in many household items and is known for  various aromatherapy uses. Almost always found in liquid form, it is colorless  and is not a pure compound.  The biggest  producer is currently Bulgaria, although there are many sources from around the  world that are also large lavender oil producers.  Each of these regions around the world are  known for producing a product with slightly different characteristics and aromas.  It is for this reason that we carry 8  different versions at this time and are currently one of the largest importers  of lavender essential oil in the USA.', 1, 'OZ', 10.00, '2e541eff1ecf9c29cd8b82820e3257c6', 0),
(340, 289, 'Scented Eucalyptus Massage oil ', 'Description: Ingredients: Glycine Soja (Soybean Oil), Prunus Amygdalus Dulcis (Sweet Almond Oil), Seamum Indicum (Sesame Seed Oil), Isopropyl Palmitate (Synthetic Moisturizer from Coconut Oil), Aloe Barbadensis (Aloe Vera Extract), Tocopherol (Antioxidant), Vegetable Oil, TBHQ (Antioxidant & Oil Preservative), Glyceryl Oleate (Anti-foaming agent extracted from vegetable oils', 6, 'OZ', 6.00, '2e541eff1ecf9c29cd8b82820e3257c6', 0),
