(346, 7, 'SOAP - Papaya Glycerin Noodle Soap with Sweet Almond Oil', '5oz Bar. 100% Vegetable Based Papaya Soap.\n\nSunaroma introduces to you its one of a kind Papaya Glycerin Noodle Soap with Sweet Almond Oil.\n\nThis ultra rich body bar with cucumber extract helps keep your skin clean, soft and moisturized using its distinctive glycerin noodles which helps attract moisture to your skin as an aromatherapeutic blend of Papaya & Sweet Almond Oil help relax your body and soul.', 1, ' Pc', 2.95, '4fb9191eb2abb4dcb071c73ed4732abc', 0),
